import React from 'react';

import '../layout/menubar';
import { Topbar } from '../layout/topbar';
import { Menubar } from '../layout/menubar';
import { AiOutlinePlus, AiOutlineSearch } from 'react-icons/ai';
import TableNumber from './table-number';
import Nextpage from '../layout/nextpage';
import { FaRegCalendarAlt } from 'react-icons/fa';
import Calendar from 'react-calendar';
import { RiArrowDownSLine, RiArrowUpSLine } from 'react-icons/ri';

let newDate = new Date()


class NumberOrder extends React.Component {
    Chose = (id: string, input: string) => {
        const ip: any = document.getElementById(input)
        const text: any = document.getElementById(id)
        ip.value = text.innerText
    }

    show = (id: string, u: string, d: string) => {
        const ip: any = document.getElementById(id)
        const up: any = document.getElementById(u)
        const down: any = document.getElementById(d)
        if (ip.style.display == 'none') {
            ip.style.display = 'block';
            up.style.display = 'flex';
            down.style.display = 'none';
        } else {
            ip.style.display = 'none';
            down.style.display = 'flex';
            up.style.display = 'none';
        }
    }
    OnClick() {
        const cld: any = document.querySelector('.daytime-picker-caledar-qlcs')
        if (cld.style.display == "none") {
            cld.style.display = "block";
        } else {
            cld.style.display = 'none';
        }


    }
    render() {
        return (
            <div className='bg'>
                <div className="Backgroundapp">
                    <a href='/NumberOrder/AddNumber'>
                        <div className='div-add'>
                            <div className='plus'><AiOutlinePlus className='cong' /></div>
                            <div className='add'>
                                <p > Cấp </p>
                                <p >số mới</p>
                            </div>
                        </div>
                    </a>
                    <div className='qlcs'>
                        <div className='qlcs-tdv'>
                            <p>Tên dịch vụ</p>
                            <div className="select-tdv">
                                <input onClick={() => this.show('tthd', 'up', 'down')} id='ip' className='select-tdv' value={'Tất cả'} style={{ marginLeft: '4px', fontSize: '16px' }}></input>
                                <button onClick={() => this.show('tthd', 'up', 'down')} id='down'><RiArrowDownSLine /></button>
                                <button onClick={() => this.show('tthd', 'up', 'down')} id='up' style={{ display: 'none' }}><RiArrowUpSLine /></button>
                            </div>
                            <div id='tthd' className='select-drop-down' onClick={() => this.show('tthd', 'up', 'down')}>
                                <div className='select-drop-down-item ' onClick={() => this.Chose('tc', 'ip')}><a id='tc'>Tất cả</a></div>
                                <div className='select-drop-down-item ' onClick={() => this.Chose('kt', 'ip')}><a id='kt'>Kế toán</a></div>
                                <div className='select-drop-down-item ' onClick={() => this.Chose('bs', 'ip')}><a id='bs'>Bác sĩ</a></div>
                                <div className='select-drop-down-item ' onClick={() => this.Chose('ad', 'ip')}><a id='ad'>Admin</a></div>
                                <div className='select-drop-down-item ' onClick={() => this.Chose('sa', 'ip')}><a id='sa'>Super Admin</a></div>
                            </div>
                            {/* <select className='select-tdv'>
                                <option value="all">Tất cả</option>
                                <option value="PhuSan">Phụ sản</option>
                                <option value="TongQuat">Tổng quát</option>
                                <option value="RangHamMat">Răng hàm mặt</option>
                            </select> */}
                        </div>
                        <div className='qlcs-tdv'>
                            <p>Tình trạng</p>
                            <select className='select-tdv'>
                                <option value="all">Tất cả</option>
                                <option value="wati">Đa chờ</option>
                                <option value="used">Đã sử dụng</option>
                                <option value="next">Bỏ qua</option>
                            </select>
                        </div>
                        <div className='qlcs-tdv'>
                            <p>Nguồn cấp</p>
                            <select className='select-tdv'>
                                <option value="all">Tất cả</option>
                                <option value="Kiosk">Kiosk</option>
                                <option value="HeThong">Hệ thống</option>
                            </select>
                        </div>
                        <div className='qlcs-tdv'>
                            <p>Chọn thời gian</p>
                            <div className='ctg-row '>
                                <div className='daytime-picker-qlcs' onClick={this.OnClick} >
                                    <FaRegCalendarAlt className='icon-calendar' />
                                    <p>{newDate.toLocaleDateString()}</p>
                                </div>
                                <p style={{ color: '#535261', margin: '10px', display: 'flex' }} >▸</p>
                                <div className='daytime-picker-qlcs' >
                                    <FaRegCalendarAlt className='icon-calendar' />
                                    <p>{newDate.toLocaleDateString()}</p>
                                </div>
                            </div>
                        </div>
                        <div className='qlcs-tdv'>
                            <p >Từ khóa</p>
                            <div className='sreach-qlcs' >
                                <form  >
                                    <input type="text" name='timkiem' placeholder="Nhập từ khóa ..." style={{ fontSize: '14px' }} ></input>
                                    <button className="sreach-sv-button" type='submit'><AiOutlineSearch /></button>
                                </form>

                            </div>
                        </div>

                    </div>
                    <TableNumber />
                    <div className='daytime-picker-caledar-qlcs' id='cldsv'>
                        <Calendar locale='en' selectRange />
                    </div>


                    <div className='title-report-type'>Quản lý cấp số</div>
                    <Nextpage />
                    <Topbar nametitle1='Cấp số ﹥ ' nametitle2='' nametitle3='Danh sách cấp số' href='' href2='' nametitle21='' />
                    <Menubar buttonid="cs" />

                </div>
            </div>
        );

    }


}

export default NumberOrder;
